        /** Fired when HTTP response is available. */
        emitResponseReceived(params: Network.ResponseReceivedEvent): void;

        /** Fired when data chunk was received over the network. */
        emitDataReceived(params: Network.DataReceivedEvent): void;

        /** Fired when HTTP request has finished loading. */
        emitLoadingFinished(params: Network.LoadingFinishedEvent): void;

        /** Fired when HTTP request has failed to load. */
        emitLoadingFailed(params: Network.LoadingFailedEvent): void;

        /** Fired when WebSocket is about to initiate handshake. */
        emitWebSocketWillSendHandshakeRequest(params: Network.WebSocketWillSendHandshakeRequestEvent): void;

        /** Fired when WebSocket handshake response becomes available. */
        emitWebSocketHandshakeResponseReceived(params: Network.WebSocketHandshakeResponseReceivedEvent): void;

        /** Fired upon WebSocket creation. */
        emitWebSocketCreated(params: Network.WebSocketCreatedEvent): void;

        /** Fired when WebSocket is closed. */
        emitWebSocketClosed(params: Network.WebSocketClosedEvent): void;

        /** Fired when WebSocket frame is received. */
        emitWebSocketFrameReceived(params: Network.WebSocketFrameReceivedEvent): void;

        /** Fired when WebSocket frame error occurs. */
        emitWebSocketFrameError(params: Network.WebSocketFrameErrorEvent): void;

        /** Fired when WebSocket frame is sent. */
        emitWebSocketFrameSent(params: Network.WebSocketFrameSentEvent): void;

        /** Fired when EventSource message is received. */
        emitEventSourceMessageReceived(params: Network.EventSourceMessageReceivedEvent): void;

        expose(domain: NetworkCommands): void;

